import React, {Component} from 'react';
import axios from 'axios';
import {
    IonCard,
    IonCardContent,
    IonContent,
    IonHeader,
    IonPage,
    IonTitle,
    IonToolbar

  } from '@ionic/react';

class Tab3 extends Component {
  API_KEY = '7cf1d03c7aab53b9a719411f7a699cef';
  API_URL = `api.openweathermap.org/data/2.5/weather?lat=-31.6291409&lon=-60.71936410000001&APPID=${this.API_KEY}`

  state = {
    items: []
  }

  componentDidMount() {
    axios.get(this.API_URL).then(response => response.data)
    .then((data) => {
      this.setState({ items: data })
      console.log(this.state.items)
     })
  }
  render() {
    return (
      <IonPage>
      <IonHeader>
        <IonToolbar color="primary">
          <IonTitle>News App v1.0</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
      {this.state.items.map((item) => (
                <IonCard>


                <IonCardContent>
                  <p>{item}</p>

                </IonCardContent>
                </IonCard>

      ))}

      </IonContent>
    </IonPage>

    );
  }
}

export default Tab3;
